function daystring(day) { return ["Mon","Tue","Wed","Thu","Fri","Sat","Sun"][day];}
function monthstring(month) { return ["Jan", "Feb", "Mar", "Apr", "May", "Jun", "Jul", "Aug", "Sep", "Oct", "Nov", "Dec"][month];}
function getTimeStamp() { var now = new Date();
    return ( daystring(now.getDay())+","+ now.getFullYear() + ' ' + monthstring(now.getMonth() + 1) + ' ' + (now.getDate()) + " " + now.getHours() + ':' +
        ((now.getMinutes() < 10) ? ("0" + now.getMinutes()) : (now.getMinutes())) + ':' + ((now.getSeconds() < 10) ? ("0" + now
            .getSeconds()) : (now.getSeconds())) + " GMT");
}

